import React from 'react';
import '../styles/ReviewsPage.css';
import ReviewItem from '../components/ReviewItem'; // Импортируем ReviewItem

const ReviewsPage = () => {
  const reviews = [
    {
      images: ['path/to/review1.jpg', 'path/to/review2.jpg'], // Путь к изображениям
      text: 'Отличный сервис! Всегда радует качество кофе и приятная атмосфера.',
      author: 'Мария'
    },
    {
      images: ['path/to/review3.jpg'], // Путь к изображению
      text: 'Посетил эту кофейню вчера впервые, и остался очень доволен! Обязательно вернусь снова.',
      author: 'Иван'
    },
    // Добавьте остальные отзывы
  ];

  return (
    <div className="reviews-page">
      <h2>Отзывы клиентов</h2>
      {reviews.map((review, index) => (
        <ReviewItem key={index} review={review} />
      ))}
    </div>
  );
}

export default ReviewsPage;
